"original": |2-
     *  A field name MUST NOT contain characters in the ranges 0x00-0x20,
        0x41-0x5a, or 0x7f-0xff (all ranges inclusive).  This specifically
        excludes all non-visible ASCII characters, ASCII SP (0x20), and
        uppercase characters ('A' to 'Z', ASCII 0x41 to 0x5a).
"fixed": |-
  *  A field name MUST NOT contain characters in the ranges 0x00-0x20, 0x41-0x5a, or 0x7f-0xff (all ranges inclusive).  This specifically excludes all non-visible ASCII characters, ASCII SP (0x20), and uppercase characters ('A' to 'Z', ASCII 0x41 to 0x5a).
"ko": |-
  * 필드 이름에는 0x00-0x20, 0x41-0x5a 또는 0x7f-0xff(모든 범위 포함) 범위의 문자가 포함되어서는 안 됩니다. 이는 특히 표시되지 않는 모든 ASCII 문자, ASCII SP(0x20) 및 대문자('A' ~ 'Z', ASCII 0x41 ~ 0x5a)를 제외합니다.
